import React from 'react';
import Jsicon from './Images/icons8-javascript-48.png';
import Bootstrapicon from './Images/icons8-bootstrap-48.png';
import Css from './Images/icons8-css3-48.png';
import Html from './Images/icons8-html-5-48.png';
const Projects = () => {
  return (
    <div className="bg-color set">
      <div className="flex">
        <div className="js">
          <img src={Jsicon} />
        </div>
        <div className="bootstrap">
          <a>
            <img src={Bootstrapicon} />
          </a>
        </div>
        <div className="css">
          <img src={Css} />
        </div>
        <div className="html">
          <a href="./creative-skill/index.html">
            <img src={Html} />
          </a>
        </div>
      </div>
    </div>
  );
};

export default Projects;
